ultimaApresentacaoProposicao_descricao:
Apresentação do REQ n. 6/2024 (Requerimento de Audiência Pública), pelo Deputado(a) Padre João (PT-MG), que: "Requer a realização de audiência pública desta Comissão para debater as situações integrais da barragem de rejeitos Forquilha III, da companhia Vale. S.A. em Ouro Preto/MG, o que inclui os drenos dessa barragem; e da estrutura de contenção de rejeitos da Vale S.A. em São Gonçalo do Bação, Distrito de Itabirito/MG. Convidados: Mauro Henrique Moreira Sousa, representando a Agencia Nacional de Mineracao (ANM);
Marilia Carvalho de Melo, representando a Secretaria de Estado de Meio Ambiente de Minas Gerais (SEMAD);
Eduardo Bartolomeo, representando a Companhia Vale S.A.; Orlando Amorim Caldeira, representando o Municipio de Itabirito/MG; Felipe Delabrida, representando a Defesa Civil do Municipio de Itabirito/MG; Angelo Oswaldo de Araújo Santos, representando o Município de Ouro Preto/MG; Francisco de Assis Gonzaga, representando a Secretaria de Meio Ambiente e Desenvolvimento Sustentável do Município de Ouro Preto; Daniel da Mota Neri, representando o Instituto Federal de Educação, Ciência e Tecnologia de Minas Gerais; Euler de Carvalho Cruz, representando o Instituto Fórum Permanente São Francisco; e Sandoval de Souza, representando o Instituto Fórum Permanente São Francisco".
